@ptn・8 

**ANNOUNCEMENT FOR ALL PARTICIPANTS**

With the move to PTN, we will be stopping registration on SN8 at Wednesday, March 20, 2024 5:00:00 PM. After all validators have successfully moved onto PTN source code on Friday, we will look to reopen registrations at Friday, March 22, 2024 4:00:00 PM with a floor registration fee of 5 TAO and an immunity period of 5 days.

@ptn・8 

**ANNOUNCEMENT FOR VALIDATORS**

**REMINDER - We will be going live with our Proprietary Trading Network (PTN) on SN8 at Friday, March 22, 2024 12:00:11 PM. All validators will need to switch to running PTN at that time. Our Time Series Prediction Subnetwork will cease running.**

@ptn・8 

**VALIDATORS - PTN GO TIME!**

**All Validators should switch over to PTN at this time.**

@ptn・8 R 1.0.3

we've fixed the directory issue (FileNotFoundError) thats been reported. 

We have a miner sending out requests every few mins from `5G1iDH2gvdAyrpUD4QfZXATvGEtstRBiXWieRDeaDPRfPEcU` on mainnet for validators to ensure they can receive requests properly. Please make sure you're seeing requests from the designated miner hotkey. If you do not please let us know, it would mean your validator doesn't have a static IP setup properly to receive requests.

@ptn・8 R1.0.4

please pull the latest by hand from github and restart `run.sh` script. There was an error on where it was pointing to grab the latest changes from github.

Similar to TSPS f you ever need to check the version youre running you can check `meta/meta.json`

@ptn・8 

2 hours until we open registrations for all miners. Are any validators seeing any issues with R1.0.5?

I want to make sure we've squashed any reported bugs, and if there are any bugs if theyre localized to a specific validator so we can assess their setup.
